export function settags(tags) {
    return {
        type: '@TAGS/SET_TAGS',
        tags
    };
}

export function createTag(tags) {
    return {
        type: '@TAG/END_CREATE_TAGS',
        tags
    };
}

export function clearTag(tags) {
    return {
        type: '@TAG/CLEAR_TAGS',
        tags
    };
}

export function setImg(image) {
    return {
        type: '@IMG/SET_IMG',
        image
    };
}
